

const { Member, CheckingPeriod, Enrollment } = require('../models/index.js')
const { errorResonse, succesResponse } = require('./JsonDefault.js')
const QRCode = require('qrcode')
const pkg = require('canvas')
const { fileURLToPath } = require('url')
const path = require('path')
const pkgLodash = require('lodash')
const { dateParser } = require('../misc/DateParser.js')
const { Op } = require('sequelize')


const { createCanvas, loadImage } = pkg;
const { chunk, isEmpty } = pkgLodash


const createMember = async (req, res) => {
    try {
        if (req.body.enrollmentId) {
            const homeNumberUpperCase = req.body.homeNumber.toUpperCase() || ''
            const bodyManipulate = { ...req.body, homeNumber: homeNumberUpperCase }
            const checkingDuplicate = req.body.role === 'MEMBER' ? await checkingDuplicateMember(bodyManipulate) : false
            if (!checkingDuplicate) {
                await Member.create(bodyManipulate).then(async (x) => {
                    if (req.body.role === 'MEMBER') {
                        await addQRCode(bodyManipulate, x.dataValues.id)
                    }
                    return res.status(201).json(succesResponse({ msg: "Data Berhasil Disimpan" }))

                })
            } else res.json(errorResonse('Data Sudah Pernah di Masukan'))

        } else res.json(errorResonse('idEnrrollment'))


    } catch (error) {
        return res.json(errorResonse(error))
    }
}
const checkingDuplicateMember = async (data) => {
    try {
        const { enrollmentId, homeNumber, rt, rw, role } = data
        const findMember = await Member.findOne({
            where: {
                enrollmentId: enrollmentId,
                homeNumber: homeNumber,
                rt: rt,
                rw: rw,
                role: role
            },
        })
        return findMember
    } catch (error) {
        return res.json(errorResonse(error))
    }
}
const addQRCode = async (data, id) => {
    const qrcode = await create(
        `https://www.artetis.com/preview-member/${id}`,
        "data:image/png;base64,",
        150,
        50,
    )
    await Member.update({ ...data, qrcode }, {
        where: {
            id: id
        }
    });
}
const getAllMember = async (req, res) => {
    try {
        const { email, role, enrollmentId, memberId } = req.query
        let members = {}
        if (email || role || enrollmentId) {
            let where = {}
            if (!isEmpty(role)) where = { ...where, role: role }
            if (!isEmpty(email)) where = { ...where, email: email }
            if (!isEmpty(enrollmentId)) where = { ...where, enrollmentId: enrollmentId }

            members = await Member.findAll({
                where: where,
                include: [CheckingPeriod, Enrollment],
                order: [
                    ['rw', 'ASC'],
                    ['rt', 'ASC'],
                    ['homeNumber', 'ASC'],
                ]
            })
        } else if (memberId) {
            members = await Member.findOne({
                where: {
                    id: memberId
                },
                include: [CheckingPeriod, Enrollment],

            });
        }
        else {
            members = await Member.findAll({
                include: [CheckingPeriod, Enrollment],
                order: [
                    ['rw', 'ASC'],
                    ['rt', 'ASC'],
                    ['homeNumber', 'ASC'],
                ]
            })
        }
        res.json(succesResponse(members))
    } catch (error) {
        res.json(errorResonse(error))
    }
}

const getOrganizationalStructure = async (req, res) => {
    try {
        const { enrollmentId } = req.query
        let members = []
        if (enrollmentId) {
            members = await Member.findAll({
                where: {
                    [Op.or]: [
                        {
                            role: ['KETUA', 'BENDAHARA', 'PETUGAS'],
                        },
                        {
                            isSupervision: true,
                        },
                    ],
                    enrollmentId: enrollmentId
                },
                include: [CheckingPeriod, Enrollment],
            })
        }

        res.json(succesResponse(members))
    } catch (error) {

        res.json(errorResonse(error))
    }
}


