const create = async (dataForQRcode, center_image, width, cwidth) => {
    const canvas = createCanvas(width, width);
    QRCode.toCanvas(
        canvas,
        dataForQRcode,
        {
            errorCorrectionLevel: "H",
            margin: 1,
            width: 150,
            color: {
                dark: "#000000",
                light: "#ffffff",
            },
        }
    );

    const ctx = canvas.getContext("2d");
    const img = await loadImage(center_image);
    const center = 50;
    ctx.drawImage(img, center, center, cwidth, cwidth);
    return canvas.toDataURL("image/png");
}

module.exports = { createMember, checkingDuplicateMember, addQRCode, getAllMember, getOrganizationalStructure, getMemberByIdEnrollment, getMemberByEmail, printMember }